import React from 'react';

export default function Navbar() {
	return (
		<div className='navbar'>
			<div className='main-navbar'>
				<h1>Logo</h1>
				<span>
					<img src='/static/icons/menu.svg' alt='' />
				</span>
			</div>
			<div className='secondary-navbar'>
				<span>second</span>
			</div>
			<style jsx>
				{`
					.navbar {
						background: white;
						width: 100%;
						position: fixed;
					}
					.secondary-navbar {
						display: none;
					}
				`}
			</style>
		</div>
	);
}
